    rel[x.asn].peers=rels.peers.map(v=>v.asn);
    rel[x.asn].downstreams=rels.downstreams.map(v=>v.asn);
    x.bgpUpstreams=rels.upstreams.length;
    x.bgpPeers=rels.peers.length;
    x.bgpDownstreams=rels.downstreams.length;
}

